import React, {Component} from 'react';
import Main from './components/main/Main';
import { Switch, Route, Router } from 'react-router-dom';

class App extends Component {
    render() {
        return (
            <Switch>
              <Route path={`/`} component={Main} />
                <Main />
            </Switch>
        );
    }
}

export default App;
